const type = [
  {
    display: "Under 1M",
    type: "s",
  },
  {
    display: "1M-3M",
    type: "m",
  },
  {
    display: "3M-7M",
    type: "l",
  },
  {
    display: "7M-10M",
    type: "xl",
  },
  {
    display: ">10M",
    type: "xxl",
  },
];

export default type;
